import React from 'react'
import { Link } from 'react-router-dom'

export const NavBar = () => {
  return (
    <div>
        <Link className='inicio'>Inicio</Link>
        <Link className='link'>Gimnacios</Link>
        <Link className='link'>Tienda</Link>
    </div>
  )
}
